ue et Libertés<br>\n<br>\nIntroduction</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les\ninformations recueillies dans ce site font l’objet d’un\ntraitement informatique destiné à l’usage exclusif de SARL\nBULLADOM.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>BULLADOM&nbsp;s’engage\nà protéger la confidentialité de ses clients et des visiteurs de\nson site Internet, et considère la protection des données\npersonnelles comme étant d’une importance fondamentale pour le\nfonctionnement de ses activités. Les données personnelles des\nclients et des visiteurs du site sont protégées et traitées avec\nle plus grand soin.&nbsp;BULLADOM&nbsp;est\nen conformité avec les exigences de la loi Informatique et Libertés\ndu 6 janvier 1978.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\nConformément\nà la loi Informatique et Libertés du 6 janvier 1978, vous\nbénéficiez d’un droit d’accès, de modification, de suppression\net d’opposition aux données vous concernant. Si vous souhaitez\nexercer ces droits, veuillez nous contacter au&nbsp;06-83-79-40-50&nbsp;ou\nécrire à&nbsp;<a href=\"mailto:guillaumefalconnet@bulle-d-etoiles.com\">guillaumefalconnet@bulle-d-etoiles.com</a>&nbsp;.\nNous nous engageons à ne pas communiquer à des tiers les\ninformations vous concernant sauf si vous nous en donnez\nl\'autorisation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Traitement\ndes données personnelles<br>\n</strong>Les\ndonnées collectées par&nbsp;BULLADOM&nbsp;le\nsont pour assurer les services qui lui sont demandés.&nbsp;Vos\ndonnées personnelles sont stockées lorsque vous souscrivez à\nun&nbsp;abonnement, à une newsletter ou avez souscrit à un de nos\nservices. Les données personnelles stockées sont les données\ntelles que coordonnées, informations sur les paiements, données\nprofessionnelles (entreprise et poste occupé) et / ou l\'intérêt\nque vous avez porté à un de nos services.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>BULLADOM&nbsp;utilise\nces informations pour vous délivrer les services auxquels vous avez\nsouscrit, le traitement administratif et commercial de ces services\n(inscription, facturation, etc.), et vous informer des nouveaux\nservices proposés par&nbsp;BULLADOM.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n<strong>Votre\nadresse e-mail<br>\n</strong>Si\nvous avez indiqué votre adresse e-mail (par exemple pour vous\ninscrire, postuler&nbsp;ou nous contacter), celle-ci peut être\nutilisée pour vous informer sur d\'autres services proposés\npar&nbsp;BULLADOM&nbsp;qui\npeuvent vous intéresser. Si vous ne souhaitez pas recevoir ces\ninformations, vous pouvez exercer&nbsp;votre droit d\'accès, de\nmodification,&nbsp;de suppression&nbsp;et d\'opposition aux données\nvous concernant à tout moment en nous contactant au 06-83-79-40-50&nbsp;\nou par mail à&nbsp;&nbsp;<a href=\"mailto:guillaumefalconnet@bulle-d-etoiles.com\">guillaumefalconnet@bulle-d-etoiles.com</a>&nbsp;.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Historique\nde navigation et adresse IP<br>\n</strong>Pour\naméliorer la qualité de son site et de ses services\nInternet,&nbsp;BULLADOM&nbsp;collecte\nles données qui concernent la navigation sur son site Internet. Ces\ndonnées ne sont pas&nbsp;nominatives.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>BULLADOM&nbsp;utilise\négalement l\'adresse IP de votre ordinateur à cet effet.<br>\nL\'adresse\nIP est un numéro qui est automatiquement attribué à&nbsp;un\nordinateur lorsque vous naviguez sur Internet.<br>\nCette\ninformation peut être utilisée pour étudier l\'utilisation du site\nà des fins d\'analyse et de reporting, pour afficher des informations\ngéographiquement ciblées (géotargeting), ou pour adapter les\ninformations ou services en fonction de la navigation.<br>\nD\'une\nmanière générale, les adresses IP ne sont pas liées à des\ninformations qui pourraient vous identifier, sauf si vous avez donné\nvotre autorisation expresse à cet effet.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Utilisation\ndes cookies par&nbsp;</strong><strong>BULL</strong><strong>ADOM</strong><strong><br>\n</strong>Un\ncookie est une suite d\'informations envoyée par un site Internet à\nun ordinateur sous la forme d\'un petit fichier de données.&nbsp;Les\ncookies sont utiles pour faciliter la personnalisation de votre accès\nà nos services en ligne. Ils peuvent être utilisés pour une\nauthentification, une session, stocker une information spécifique\ncomme les préférences sur un site ou le contenu d\'un panier d\'achat\nélectronique.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le\nstockage des cookies se fait par le biais du navigateur Web utilisé\npar l\'internaute (par exemple Internet Explorer).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Il\nexiste deux types de cookies :<br>\n-\nles cookies de session sont supprimés de votre ordinateur lorsque\nvous fermez votre navigateur,<br>\n-\nles cookies permanents restent stockés sur votre ordinateur après\nla fermeture du navigateur.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les\ncookies sont cependant anonymes et ne sont en aucun cas utilisés\npour collecter des informations personnelles.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Refus\ndes cookies<br>\n</strong>Vous\nêtes libre d\'accepter ou de refuser les cookies en configurant votre\nnavigateur (désactivation de tout ou partie des cookies - voir\nmanuel de votre navigateur Web ou fonction d\'aide).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La\ndésactivation des cookies peut entraîner l\'indisponibilité de\ncertains services auxquels ils sont associés. Elle n\'empêche pas\nl\'accès aux espaces non-réservés du site.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Liens\nhypertextes</strong><br>\nLes\nutilisateurs sont formellement informés que les sites auxquels ils\npeuvent accéder par l\'intermédiaire des liens hypertextes\nn\'appartiennent pas tous à&nbsp;BULLADOM\n,&nbsp;BULLADOM&nbsp;décline\ntoute responsabilité quant au contenu des informations fournies sur\nles sites qui ne lui appartiennent pas, au titre de l\'activation\nde&nbsp;l\'hyperlien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Avertissement\nlégal aux utilisateurs</strong><br>\nL\'utilisateur\ndéclare accepter les caractéristiques et les limites d\'Internet et,\nen particulier, reconnaître :<br>\n-\navoir connaissance de la nature du réseau de l\'internet et en\nparticulier, de ses performances techniques et des temps de réponse,\npour consulter, interroger ou transférer les données d\'informations\n;<br>\n-\nque la communication par l\'utilisateur à des tiers de ses\nidentifiants et d\'une manière générale, de toute information jugée\npar l\'utilisateur comme personnelle ou confidentielle se fait à ses\nrisques et périls ;<br>\n-\nqu\'il appartient à l\'utilisateur de prendre toutes les mesures\nappropriées de façon à protéger ses propres données et/ou\nlogiciels de la contamination par des éventuels virus sur le réseau\nde l\'Internet;<br>\n-\nque les données circulant sur l\'Internet peuvent être réglementées\nen termes d\'usage ou protégées par un droit de propriété.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>D\'une\nmanière générale, l\'utilisateur est seul responsable du choix, de\nl\'utilisation et de l\'interprétation des données qu\'il consulte,\ninterroge et transfère sur l\'Internet et de l\'usage des services en\nligne proposés par&nbsp;BULLADOM.<br>\nwww.bulladom.com&nbsp;est\nmis en place par&nbsp;BULLADOM&nbsp;SARL\ndont le siège social est en France. Les internautes ayant accès à\nce site depuis d\'autres endroits que la&nbsp;France doivent s\'assurer\ndes lois localement applicables.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>L\'utilisateur\nreconnaît avoir vérifié que la configuration informatique utilisée\nne contient&nbsp;aucun virus et qu\'elle est en bon état de\nfonctionnement.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Droit\nde modification</strong><br>\nBULLADOM&nbsp;se\nréserve le droit d\'apporter des modifications à cette déclaration\nde confidentialité. Les visiteurs et clients du site Internet\nde&nbsp;BULLADOM&nbsp;sont&nbsp;invités\nà&nbsp;visiter régulièrement cette déclaration de confidentialité\npour y consulter la version la plus récente de la politique de\nconfidentialité du groupe.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Propriété\nintellectuelle<br>\n</strong>L’ensemble\nde ce site et des éléments qui le composent (textes,&nbsp; marques,\nlogos, graphisme, photographies, dessins, arborescence…) relèvent\nde la législation française et internationale, notamment dans les\ndomaines du droit d’auteur, de la propriété intellectuelle et des\nbases de données.&nbsp;<br>\nA\nce titre, et conformément au Code de la Propriété Intellectuelle,\nseules l’utilisation pour un usage privé, familial, scolaire, et\nla reproduction pour un usage exclusivement personnel sont\nautorisés.&nbsp;<br>\nDans\nle cadre de cet usage purement privé, la reproduction est soumise à\nla gratuité de l’utilisation, au respect des documents reproduits\n(pas de modifications), à la citation de la source\nwww.bulladom.com.&nbsp;<br>\nNous\nvous rappelons que la loi n° 98-536 du 1 er juillet 1998 relative\naux bases de données, n’accorde aucune exception de copie\nprivée.&nbsp;<br>\nToute\nexploitation non autorisée du site et de ses éléments\n(reproduction, publication, transmission…) entraîne votre\nresponsabilité et pourra donner lieu à des poursuites judiciaires.\nToutes les marques citées dans le site y compris la\nmarque&nbsp;BULLADOM&nbsp;et\nson logo sont la propriété de leurs titulaires respectifs.</p>\n<!-- /wp:paragraph -->','Mentions légales','','publish','closed','closed','','mentions-legales','','','2019-05-15 11:22:49